    function pspToJSON(psp) {
        for (let clip of psp.Clips) {
            clip.name = `${clip.Name[0].toLowerCase()}${clip.Name.slice(1)}`;
            for (let index in clip.Frames) {
                let frame = clip.Frames[index];
                let image = frame.Layers[0];

                image.history = JSON.parse(image._historyJson);
                let url = image.history._source;
                urls[clip.name + index] = "data:image/png;base64," + url;
            }
        }
        return urls;
    }
    var image = src => {
        var image = document.createElement('img');
        // image.onload = function () {
        //     ctx.drawImage(image, 0, 0); // Or at whatever offset you like
        // };
        image.setAttribute('src', src);
        return image;
    };

    function urlsToObj(urls) {
        var obj = {};
        for (let name in urls) {
            let url = urls[name];
            let img = image(url);
            obj[name] = img;
        }

        return obj;
    }
    var green_images = urlsToObj(green_urls);
